1229=>["Value"=>1229,"TextKey"=>"道具描述13311","Chinese"=>"吟游诗人们传说，有一块完全被世界树森林覆盖的大陆。","English"=>"Bards sing about a continent covered by Yggdrasill trees."],
1230=>["Value"=>1230,"TextKey"=>"道具描述13312","Chinese"=>"树上散发的能量将生命带给世界，与光产生共鸣。","English"=>"The tree brings the world back to life."],
1231=>["Value"=>1231,"TextKey"=>"道具描述13313","Chinese"=>"这棵树与它所保护的世界相通。点击获得'世界树的宝藏'。","English"=>"This tree is connected to the world which it protects. Tap to get <color=#38c0a5>Yggdrasill's Treasure</color>"],
