1399=>["Value"=>1399,"TextKey"=>"道具描述18001","Chinese"=>"不停点击获得很多【石精灵图腾】。非常坚硬。","English"=>"Keep tapping for <color=#ef933d>Totems of Stoneman</color>. Real tough!"],
1400=>["Value"=>1400,"TextKey"=>"道具描述18101","Chinese"=>"不停点击获得很多【部落战士图腾】。战士们总是在打架！","English"=>"Keep tapping for <color=#ef933d>Totems of Soldier</color>. They are always fighting!"],
1401=>["Value"=>1401,"TextKey"=>"道具描述18201","Chinese"=>"不停点击获得很多【巨龙图腾】。我们崇拜巨龙！","English"=>"Praise the dragons! Keep tapping to get their Totems."],
1402=>["Value"=>1402,"TextKey"=>"道具描述18301","Chinese"=>"不停点击获得很多【剑齿虎图腾】。","English"=>"Keep tapping for <color=#ef933d>Totems of Saber-toothed tigers</color>."],
1403=>["Value"=>1403,"TextKey"=>"道具描述17006","Chinese"=>"(部落勇士)的高级图腾群。他们将带我们走向胜利。","English"=>"Totems of chubby and strong warriors. They'll lead us to the win."],
1404=>["Value"=>1404,"TextKey"=>"道具描述17106","Chinese"=>"(部落工匠)的高级图腾群。他们身上承载着部落的未来。","English"=>"Some totems of really talented artisans.  They carry the future of the tribe."],
1405=>["Value"=>1405,"TextKey"=>"道具描述17206","Chinese"=>"(部落采集者)的高级图腾群。","English"=>"Some totems of advanced female members of the tribe."],
1406=>["Value"=>1406,"TextKey"=>"道具描述17306","Chinese"=>"(部落祭司)的高级图腾群。拨开命运的迷雾窥探未来。","English"=>"Some totems of <color=#df66a8>Advanced Priests</color>. Clear the fog of destiny to pry into the future."],
1407=>["Value"=>1407,"TextKey"=>"道具描述17406","Chinese"=>"(部落贤者)的高级图腾群。长老们是部落里最受尊敬的人。","English"=>"Some totems of <color=#df66a8>Advanced Sages</color>. Elders are the most respected ones in the tribe."],
1408=>["Value"=>1408,"TextKey"=>"道具描述17506","Chinese"=>"(猛犸象)的高级图腾群。它们巨大的身体如移动的群山。还长了毛。","English"=>"Some totems of <color=#df66a8>Giant Mommoths</color>. Their bodies are like moving furry mountains."],
1409=>["Value"=>1409,"TextKey"=>"道具描述17606","Chinese"=>"(魔法猫咪)的高级图腾群。好吧这个笑话讲过了。只是高级鳄鱼而已。","English"=>"Totems of magical kittens. Well ok, old joke. Just some <color=#df66a8>Giant Crocodiles</color>."],
1410=>["Value"=>1410,"TextKey"=>"道具描述17706","Chinese"=>"(花精灵)的高级图腾群。流光溢彩的翅膀。","English"=>"Totems of <color=#df66a8>Advanced Fairies</color>. Their wings are as soft as rainbow-colored petals. "],
1411=>["Value"=>1411,"TextKey"=>"道具描述17806","Chinese"=>"(独眼巨人)的图腾群。大地力量的化身。","English"=>"Totems of <color=#df66a8>Cyclops</color>. They are the incarnations of the power of the earth."],
1412=>["Value"=>1412,"TextKey"=>"道具描述17906","Chinese"=>"(树精灵)的高级图腾群。树也有灵魂。","English"=>"Some totems of <color=#df66a8>Advanced Treemen</color>. Trees have souls.  "],
1413=>["Value"=>1413,"TextKey"=>"道具描述18006","Chinese"=>"(石精灵)的高级图腾群。像山一样！","English"=>"Some totems of <color=#df66a8>Megalith</color>. They are literally moving mountains."],
1414=>["Value"=>1414,"TextKey"=>"道具描述18106","Chinese"=>"(部落战士)的高级图腾群。现在可不再是小打小闹了~！","English"=>"Some totems of <color=#df66a8>Advanced Soldiers</color>. They no longer fight. They conquer."],
1415=>["Value"=>1415,"TextKey"=>"道具描述18206","Chinese"=>"(巨龙)的高级图腾群。来自遥远的过去。","English"=>"Some totems of <color=#df66a8>Advanced Dragons</color>. From the distant past."],
1416=>["Value"=>1416,"TextKey"=>"道具描述18306","Chinese"=>"(剑齿虎)的高级图腾群。亮出尖锐的獠牙。","English"=>"Some totems of <color=#df66a8>Advanced Saber-toothed Tigers</color>. Show your fangs."],
