5854=>["Value"=>5854,"TextKey"=>"新手引导说明2002","Chinese"=>"拖动任意图腾，使3个图腾彼此相邻，它们就会自动合成，就可以解除封印啦！","English"=>"Drag any 3 <color=#38c0a5>Totems</color> of the same kind together to trigger a <color=#f58c26>Merge</color>, and the curse will be lifted."],
