5856=>["Value"=>5856,"TextKey"=>"新手引导说明2011","Chinese"=>"看！是创世神法典，在各个关卡中都会看到它，其中的记录一定可以帮到你。","English"=>"<line-height=130%>Look! That's the <color=#f58c26>Code of Creation</color>. You'll see it in various levels. What it documents will definitely help you."],
5857=>["Value"=>5857,"TextKey"=>"新手引导说明2012","Chinese"=>"点击它，可以查看游戏的相关说明，试试看吧！","English"=>"<line-height=130%>Tap it to check the instructions of the game. Try it out!"],
5858=>["Value"=>5858,"TextKey"=>"新手引导说明2020","Chinese"=>"想要获得关卡的胜利，需要按要求获得指定的物品。","English"=>"<line-height=130%>If you want to beat a level, you need to get a <color=#f58c26>Designated Object</color>."],
5859=>["Value"=>5859,"TextKey"=>"新手引导说明2022","Chinese"=>"在关卡目标中，会显示你需要获得的物品。开始合成，赢得胜利吧！","English"=>"<line-height=130%>The <color=#f58c26>Level Objective</color> will tell you what you need to get. Start merging and win!"],
5860=>["Value"=>5860,"TextKey"=>"新手引导说明2030","Chinese"=>"哇！创世少女雕像！她们也被邪恶巫师封印了！需要通过合并唤醒她！","English"=>"<line-height=120%>Wow, a <color=#ef933d>Carving of Young Embla</color>! They are cursed by the evil sorcerer too! We need to wake <color=#f58c26>Embla</color> up through merging the carvings."],
5861=>["Value"=>5861,"TextKey"=>"新手引导说明2031","Chinese"=>"在有创世少女雕像的关卡，一般都可以通过合并她们来获得胜利。","English"=>"If a level has these carvings, you can usually beat the level through merging them."],
5862=>["Value"=>5862,"TextKey"=>"新手引导说明2032","Chinese"=>"可恶的巫师诅咒了这片土地，使它们陷入了沉睡。","English"=>"<line-height=130%>The evil sorcerer cursed these lands, and put them to deep slumber."],
5863=>["Value"=>5863,"TextKey"=>"新手引导说明2033","Chinese"=>"你无法移动在沉睡之地上的任何东西！","English"=>"<line-height=130%>You can't move any object on <color=#38aec0>Dormant Lands</color>."],
5864=>["Value"=>5864,"TextKey"=>"新手引导说明2034","Chinese"=>"合并任意的灵花来唤醒土地。","English"=>"<line-height=130%>Merge any <color=#38c0a5>Spirit Flowers</color> to wake up land."],
5865=>["Value"=>5865,"TextKey"=>"新手引导说明2035","Chinese"=>"关卡胜利后，女神会唤醒所有被巫师诅咒的土地！","English"=>"<line-height=130%>When you win, <color=#f58c26>Goddess Embla</color> will wake up all lands that has been cursed!"],
5866=>["Value"=>5866,"TextKey"=>"新手引导说明2040","Chinese"=>"看！是图腾！","English"=>"<line-height=130%>Look! It's a <color=#38c0a5>Totem</color>."],
5867=>["Value"=>5867,"TextKey"=>"新手引导说明2041","Chinese"=>"赶快合并3个图腾来解救族员吧！","English"=>"Hurry and merge <color=#38c0a5>Three Totems</color> to save the tribal member trapped inside!"],
5868=>["Value"=>5868,"TextKey"=>"新手引导说明2050","Chinese"=>"刚才我们说过，点击大地灵球可以唤醒土地。","English"=>"As we just said, you can tap a <color=#38c0a5>Wild Rune Orb</color> to wake up land."],
5869=>["Value"=>5869,"TextKey"=>"新手引导说明2051","Chinese"=>"当然你也可以通过合并获得更高等级的大地灵球。","English"=>"<line-height=130%>Of course, you can also merge them to get more advanced ones!"],
5870=>["Value"=>5870,"TextKey"=>"新手引导说明2060","Chinese"=>"可以合并普通和<沉睡之地>上的相同道具，<沉睡之地>将自动被唤醒。","English"=>"You can merge objects on <color=#38aec0>Dormant Lands</color> with ones on normal lands to wake up the dormant ones automatically."],
5871=>["Value"=>5871,"TextKey"=>"新手引导说明2070","Chinese"=>"点击图腾堆来获得'图腾'。","English"=>"Tap a <color=#38c0a5>Totem Group</color> to get a <color=#38c0a5>Totem</color>."],
5872=>["Value"=>5872,"TextKey"=>"新手引导说明2080","Chinese"=>"某些超级沉睡之地，无法被'治愈值'唤醒，只能通过与普通土地上的道具合并的方式来唤醒。","English"=>"Some <color=#38aec0>Super Dormant Lands</color> can't be awakened through <color=#f58c26>Healing points</color>, but can only be waked up through merging its objects with the ones on normal lands."],
5873=>["Value"=>5873,"TextKey"=>"新手引导说明2090","Chinese"=>"从现在开始，关卡带有任务了。","English"=>"<line-height=130%>From now on, levels come with <color=#f58c26>Tasks</color>."],
5874=>["Value"=>5874,"TextKey"=>"新手引导说明2091","Chinese"=>"您可以点击任务太阳来查看内容和奖励。","English"=>"<line-height=130%>You can check the <color=#38c0a5>Task Sun</color> for the tasks and rewards."],
5875=>["Value"=>5875,"TextKey"=>"新手引导说明2093","Chinese"=>"这个键可锁定或解锁屏幕拖动。","English"=>"<line-height=130%>This button can lock or unlock the <color=#f58c26>Screen Dragging Function</color>."],
5876=>["Value"=>5876,"TextKey"=>"新手引导说明2100","Chinese"=>"某些道具无法直接被合并，您可点击【楔形石堆】使其变为【楔形石】，再进行合并。","English"=>"Some objects can't be merged directly. Tap the <color=#ef933d>Pile of Wedge-shaped Rocks</color> to split them into <color=#ef933d>Wedge-shaped Rocks</color>  then merge. "],
5877=>["Value"=>5877,"TextKey"=>"新手引导说明2110","Chinese"=>"您需要查看这个关卡的通关目标。","English"=>"<line-height=130%>You need to check the <color=#f58c26>Level Objectives</color>."],
5878=>["Value"=>5878,"TextKey"=>"新手引导说明2130","Chinese"=>"我们可以从各种'萤火虫'中，获得【灌木绿芽】。","English"=>"<line-height=130%>We can get <color=#ef933d>Bush Sprouts</color> from <color=#38c0a5>Fireflies</color>."],
5879=>["Value"=>5879,"TextKey"=>"新手引导说明2140","Chinese"=>"这是一个超大型【唤醒炸弹】，如果你唤醒它相邻的土地，它就会自我唤醒。它自我唤醒时，会同时唤醒它四周1格的土地。","English"=>"This is a huge <color=#ef933d>Wake-up Bomb</color>. If you wake up the land next to it, it will automatically wake up, and will wake up the tiles directly surrounding it."],
5880=>["Value"=>5880,"TextKey"=>"新手引导说明2150","Chinese"=>"部落成员可以从更高级的'藤蔓'处采集到'原石矿'，您可以点击来收集。","English"=>"Tribal members can collect <color=#38c0a5>Wild Ores</color> for you from higher level <color=#38c0a5>Vines</color> ."],
5881=>["Value"=>5881,"TextKey"=>"新手引导说明2160","Chinese"=>"这是一个【破碎墓碑】。如果放任它们不管或合并，它们会变化为恐怖的僵尸。击杀僵尸后，会获得'珊瑚'道具，也就是通过本关必需的道具。","English"=>"This is a <color=#ef933d>Shattered Tomb</color>. If you neglect or merge them, they will turn into terrifying <color=#df66a8>Zombies</color>. Defeat them to get <color=#38c0a5>Corals</color>, which you need to pass the level."],
5882=>["Value"=>5882,"TextKey"=>"新手引导说明2170","Chinese"=>"【荒废的壁巢】会持续不断地产生僵尸，无论其是否处于唤醒状态。点击它会立即产生一只僵尸。破坏【荒废的壁巢】之后，会获得大量的原石矿奖励。","English"=>"An <color=#ef933d>Abandoned Wallnest</color> constantly generates zombies even while dormant. Tapping it generates a zombie immediately! Destroying zombies gives you <color=#38c0a5>Wild Ores</color>."],
5883=>["Value"=>5883,"TextKey"=>"新手引导说明2180","Chinese"=>"这是一个'德鲁伊符文阵'，运气真好！合并它们，可以从营地里随机召唤一个'部落成员'来帮忙。","English"=>"This is a <color=#38c0a5>Druid's Rune Portal</color>, how lucky we are! Merge them to summon a <color=#38c0a5>Tribal Member</color> from Homeland to help you."],
5884=>["Value"=>5884,"TextKey"=>"新手引导说明2190","Chinese"=>"创世神树遗留的圣物，它们可以自动生成大地灵球唤醒土地。创世神树遗留的圣物等级越高，治愈能力越强。","English"=>"The remanence of the Holy Tree of Creation. Automatically produces <color=#38c0a5>Wild Rune Orbs</color>. The higher the level, the stronger the healing power is."],
5885=>["Value"=>5885,"TextKey"=>"新手引导说明2200","Chinese"=>"这里会不断出现【荒野云朵】，点击它们，使它们持续下雨。下雨范围内的空白土地，会持续产生'水坑'和'灵花'。","English"=>" <color=#ef933d>Clouds</color> will keep appearing from here. Tap them to make them rain. <color=#38c0a5>Puddles</color> and <color=#38c0a5>Spirit Flowers</color> will appear on empty lands below them."],
5886=>["Value"=>5886,"TextKey"=>"新手引导说明2210","Chinese"=>"奇怪，【创世少女像】去哪里了？","English"=>"<line-height=130%>Strange…where are the <color=#ef933d>Carvings of Young Embla</color>?"],
5887=>["Value"=>5887,"TextKey"=>"新手引导说明2211","Chinese"=>"哦对了，如果你完成任务，她们就会出现！","English"=>"<line-height=130%>Oh, yes, if you complete your <color=#f58c26>Tasks</color>, they will appear!"],
5888=>["Value"=>5888,"TextKey"=>"新手引导说明2220","Chinese"=>"这是【魔神雕像】，丑陋的东西！命令你的部落成员消灭它，会获得【创世少女像】。","English"=>"This is a <color=#ef933d>Statue of Demon</color>. Hideous piece of work! Order your people to annilate it to get a <color=#ef933d>Carving of Young Embla</color>."],
5889=>["Value"=>5889,"TextKey"=>"新手引导说明2230","Chinese"=>"有新的营地被开启，快去看看！","English"=>"<line-height=130%>A <color=#f58c26>New Camp</color> has opened. Go have a look!"],
5890=>["Value"=>5890,"TextKey"=>"新手引导说明2240","Chinese"=>"我重获自由啦，谢谢。","English"=>"<line-height=130%>I'm free again! Thank you so much!"],
5891=>["Value"=>5891,"TextKey"=>"新手引导说明2241","Chinese"=>"邪恶的巫师把我们的族员都禁锢在这些图腾中了。","English"=>"<line-height=130%>The evil sorcerer has locked the people of our tribe in these <color=#38c0a5>Totems</color>."],
5892=>["Value"=>5892,"TextKey"=>"新手引导说明2242","Chinese"=>"我们的部落需要您来拯救，要寻找其他被禁锢的族员。","English"=>"<line-height=130%>The tribe needs your help to find other tribal members."],
5893=>["Value"=>5893,"TextKey"=>"新手引导说明2243","Chinese"=>"去下一个关卡中找找吧！","English"=>"<line-height=130%>Go search for them in the next level!"],
5894=>["Value"=>5894,"TextKey"=>"新手引导说明2250","Chinese"=>"可以通过双击某些物品或拖动族员到物品上让他们进行采集。","English"=>"You can <color=#f58c26>double-tap</color> some objects to call someone here to harvest from it."],
5895=>["Value"=>5895,"TextKey"=>"新手引导说明2251","Chinese"=>"采集的物品可供你使用或合并。","English"=>"<line-height=130%>You can use or merge the objects you've gathered."],
5896=>["Value"=>5896,"TextKey"=>"新手引导说明2252","Chinese"=>"采集灵花可以获得灵球。","English"=>"<line-height=130%>Harvest from a <color=#38c0a5>Spirit Flower</color> to get a <color=#38c0a5>Wild Rune Orb</color>."],
5897=>["Value"=>5897,"TextKey"=>"新手引导说明2253","Chinese"=>"点击灵球可以唤醒沉睡的土地。","English"=>"<color=#f58c26>Tap the orb</color> to wake up <color=#38aec0>Dormant Lands</color>."],
5898=>["Value"=>5898,"TextKey"=>"新手引导说明2261","Chinese"=>"从现在开始，关卡结束时可以选择奖励了。","English"=>"<line-height=130%>From now on, you can select rewards at the end of each level."],
5899=>["Value"=>5899,"TextKey"=>"新手引导说明2262","Chinese"=>"奖励通常都是金币和其他有用的东西。有时候甚至是一个图腾。","English"=>"<line-height=130%>Rewards are usually <color=#38c0a5>Gold</color> or other useful resources. Sometimes even a totem!"],
5900=>["Value"=>5900,"TextKey"=>"新手引导说明2263","Chinese"=>"你的奖励会被装进大地泡泡中，送回到家园中了。","English"=>"<line-height=130%>Your rewards will be put into <color=#f58c26>Bubbles</color> and sent back home."],
5901=>["Value"=>5901,"TextKey"=>"新手引导说明3000","Chinese"=>"这就是我们的家园。","English"=>"<line-height=130%>This is our <color=#f58c26>Homeland</color>."],
5902=>["Value"=>5902,"TextKey"=>"新手引导说明3001","Chinese"=>"我们的部落曾经生活在这里，但邪恶的巫师召唤迷雾遮盖了这片土地。","English"=>"<line-height=130%>Where it used to be our home, before the evil sorcerer cast a heavy fog on this land."],
5903=>["Value"=>5903,"TextKey"=>"新手引导说明3002","Chinese"=>"将道具与沉睡之地上的道具合并可以直接唤醒该地块。尝试合并解封族员吧，就能驱除越多的迷雾。","English"=>"<line-height=115%>Merge objects with ones on dormant lands to wake up land directly! Try to merge and rescue more tribal members! The more tribal members you have, the more fog you can clear up."],
5904=>["Value"=>5904,"TextKey"=>"新手引导说明3005","Chinese"=>"至多开启一个'时间宝箱'，待倒计时结束可以获得奖励。也可花费宝石直接打开任何时间宝箱。","English"=>"<line-height=130%>You can only unlock one <color=#38c0a5>Time Treasure Chest</color> at once. Wait for the end of the countdown to get them, or spend Rubies to get any <color=#38c0a5>Time Treasure Chests</color> immediately."],
5905=>["Value"=>5905,"TextKey"=>"新手引导说明3006","Chinese"=>"关卡中的奖励已经发送到了这里，打开泡泡看看吧。","English"=>"<line-height=130%>Level rewards have arrived! Open the bubbles and check them out!"],
5906=>["Value"=>5906,"TextKey"=>"新手引导说明3010","Chinese"=>"长屋'是部落成员休息的场所，一段时间后部落成员可重新活动。","English"=>"<line-height=130%><color=#38c0a5>Longhouses</color> are places where workers can get some rest. They'll come out after a certain amount of time."],
5907=>["Value"=>5907,"TextKey"=>"新手引导说明3011","Chinese"=>"长屋'可以合并为更高级的长屋，长屋等级越高，对应所需的休息时间越短。","English"=>"<line-height=130%><color=#38c0a5>Longhouses</color> can be merged into higher level ones. The higher the level, the shorter the time it takes for tribal members to rest inside."],
5908=>["Value"=>5908,"TextKey"=>"新手引导说明3016","Chinese"=>"可以花费宝石立即唤醒他们。","English"=>"<line-height=130%>Spend <color=#38c0a5>Rubies</color> to wake them up immediately."],
5909=>["Value"=>5909,"TextKey"=>"新手引导说明3030","Chinese"=>"可完成家园任务来获得更多的'大地遗产'，点击'大地遗产'，可获得特殊战利品。","English"=>"You can complete more tasks at Homeland to get more <color=#38c0a5>Forgotten Heritage</color>. Tap them to get special rewards!"],
5910=>["Value"=>5910,"TextKey"=>"新手引导说明3040","Chinese"=>"这是一枚小'金块'。","English"=>"<line-height=130%>This is a tiny piece of <color=#38c0a5>Gold</color>."],
5911=>["Value"=>5911,"TextKey"=>"新手引导说明3041","Chinese"=>"您可以点击它们获得金币资源，也可以合并更高级的金块。","English"=>"<line-height=120%>You can tap them to get some <color=#38c0a5>Gold</color>, or you can merge them into more advanced gold nuggets."],
5912=>["Value"=>5912,"TextKey"=>"新手引导说明3042","Chinese"=>"金块资源可以在商店中花费","English"=>"<line-height=130%>You can spend your <color=#38c0a5>Gold</color> at the <color=#f58c26>Shop</color>."],
5913=>["Value"=>5913,"TextKey"=>"新手引导说明3050","Chinese"=>"金块满了？你可以去商店买点好东西！","English"=>"<line-height=130%>Too much gold? You can go buy some really good stuff at the shop!"],
5914=>["Value"=>5914,"TextKey"=>"新手引导说明3060","Chinese"=>"所有的'部落成员'都没力气了，需要休息一段时间。","English"=>"<line-height=130%>All <color=#38c0a5>Tribal Members</color> are too tired. They need a break to restore their energy."],
5915=>["Value"=>5915,"TextKey"=>"新手引导说明3061","Chinese"=>"现在赶紧去挑战更多关卡解救更多族员吧！","English"=>"<line-height=130%>Time to beat more levels and save more people!"],
5916=>["Value"=>5916,"TextKey"=>"新手引导说明3062","Chinese"=>"你拥有的族员越多，在他们休息前，能为你采集到的东西就越多！","English"=>"<line-height=120%>The more tribal members you have, the more resources they can gather for you before they go to sleep."],
5917=>["Value"=>5917,"TextKey"=>"新手引导说明3063","Chinese"=>"可以通过赢得关卡的胜利来解救更多的族员，","English"=>"<line-height=130%>Beat levels to rescue more tribal members."],
5918=>["Value"=>5918,"TextKey"=>"新手引导说明3064","Chinese"=>"然后就可以带领他们回家！","English"=>"<line-height=130%>And bring them back home!"],
5919=>["Value"=>5919,"TextKey"=>"新手引导说明3065","Chinese"=>"看！从这里可以通过世界地图前往关卡！","English"=>"<line-height=130%>Look! You can go to the Camp through tapping the <color=#f58c26>World Map</color>."],
5920=>["Value"=>5920,"TextKey"=>"新手引导说明3070","Chinese"=>"没地方放啦！地上已经铺满啦！","English"=>"<line-height=130%>There's no space to put anything anymore: the ground is completely covered!"],
5921=>["Value"=>5921,"TextKey"=>"新手引导说明3071","Chinese"=>"选中一个道具，然后在信息区域选择出售或者销毁。","English"=>"<line-height=130%>Select an object, and select in the information box to sell or discard it. "],
5922=>["Value"=>5922,"TextKey"=>"新手引导说明3080","Chinese"=>"这是一个'异星遗产'，它非常稀有！点击它可获得宝石，也可以合并它们，获得更高等级的'异星遗产'。","English"=>"This is an <color=#38c0a5>Alien Heritage</color>, it's extremely rare! Tap it to receive <color=#38c0a5>Rubies</color>! Or you can merge them into more advanced ones!"],
5923=>["Value"=>5923,"TextKey"=>"新手引导说明3090","Chinese"=>"这是一块'原石'矿渣。","English"=>"<line-height=130%>This is a piece of <color=#38c0a5>Wild Ore</color>."],
5924=>["Value"=>5924,"TextKey"=>"新手引导说明3091","Chinese"=>"您可以点击它们获得'原石'资源，也可以合并为更高级的原石矿。","English"=>"<line-height=130%>You can tap them to collect <color=#38c0a5>Wild Ores</color>, or you can merge them to get more advanced ones!"],
5925=>["Value"=>5925,"TextKey"=>"新手引导说明3092","Chinese"=>"原石资源可以在商店中花费。","English"=>"<line-height=130%>You can spend the <color=#38c0a5>Wild Ores</color> you collected at the <color=#f58c26>Shop</color>."],
5926=>["Value"=>5926,"TextKey"=>"新手引导说明3100","Chinese"=>"如果原石已满，可通过商店购买来花费掉。","English"=>"<line-height=130%>If your <color=#38c0a5>Wild Ore</color> storage is becoming too packed, you can also spend them at the shop."],
5927=>["Value"=>5927,"TextKey"=>"新手引导说明3110","Chinese"=>"这是可恶的'路障'，平时是无法移动的。可以命令部落成员去攻击，或者双击'路障'。击碎'路障'后，可能产生较小的'路障'。","English"=>"This <color=#38c0a5>Roadblock</color> here bothers me a lot! But you can't move it directly. You can order your <color=#38c0a5>Tribal Members</color> to attack it to spilt it into smaller roadblocks."],
5928=>["Value"=>5928,"TextKey"=>"新手引导说明3120","Chinese"=>"未被唤醒的炮台也能攻击并污染周围的土地。进度条表示开炮间隔。但唤醒它才能攻击它！","English"=>"<color=#38c0a5>Barbettes</color> contaminate lands even while on dormant land. The <color=#f58c26>Progress Bar</color> shows how long between each firing. You can only attack a woke barbette."],
5929=>["Value"=>5929,"TextKey"=>"新手引导说明3130","Chinese"=>"这是英雄祭坛。英雄会在休息和巡逻状态下切换。","English"=>"This is a <color=#f58c26>Hero's Altar</color>. Heroes will switch between <color=#f58c26>Idle Mode</color> and <color=#f58c26>Patrolling Mode</color>."],
5930=>["Value"=>5930,"TextKey"=>"新手引导说明3131","Chinese"=>"英雄在时，任意4合会有额外惊喜！","English"=>"With a hero around, there will be additional surprises for any <color=#f58c26>merges of 4 objects</color>!"],
5931=>["Value"=>5931,"TextKey"=>"新手引导说明3132","Chinese"=>"若处于休息状态下，可以花费宝石将其直接唤醒。","English"=>"If they are idle, you can spend <color=#38c0a5>Rubies</color> to wake them up immediately."],
5932=>["Value"=>5932,"TextKey"=>"新手引导说明3142","Chinese"=>"英雄作为部落的强力单位，拥有独特的技能。","English"=>"<line-height=130%>Heroes have unique abilities as strong units of the tribe."],
5933=>["Value"=>5933,"TextKey"=>"新手引导说明3144","Chinese"=>"英雄技能，该区域可查看英雄技能的描述。","English"=>"<line-height=130%>You can check the descriptions of a hero's abilities here in the <color=#f58c26>Hero Ability Box</color>."],
5934=>["Value"=>5934,"TextKey"=>"新手引导说明3145","Chinese"=>"可提交使命来提升英雄等级。","English"=>"<line-height=130%>You can level up heroes by submitting finished <color=#f58c26>Quests</color>."],
5935=>["Value"=>5935,"TextKey"=>"新手引导说明3147","Chinese"=>"完成全部订单内容即可使英雄升级","English"=>"Finish all quests to level up your hero!"],
5936=>["Value"=>5936,"TextKey"=>"新手引导说明3150","Chinese"=>"干得漂亮，有更多的族员解除了封印！","English"=>"<line-height=130%>Great job! More tribal members broke free from the sorcerer's seal!"],
5937=>["Value"=>5937,"TextKey"=>"新手引导说明3151","Chinese"=>"部落的人口越多，就可以清除更多的迷雾！","English"=>"With more members in your tribe, you can clear more <color=#f58c26>Fog</color>!"],
5938=>["Value"=>5938,"TextKey"=>"新手引导说明3152","Chinese"=>"每一个区域的迷雾都需要一定程度的繁荣度才可以驱除。","English"=>"<line-height=130%>The fog in each area requires certain level of prosperity to clear up."],
5939=>["Value"=>5939,"TextKey"=>"新手引导说明3153","Chinese"=>"现在已有一块迷雾可以点击清除了。","English"=>"<line-height=130%>Now we can clear the fog in this area!"],
5940=>["Value"=>5940,"TextKey"=>"新手引导说明3161","Chinese"=>"当前迷雾不可驱除","English"=>"You can't clear this fog yet."],
5941=>["Value"=>5941,"TextKey"=>"新手引导说明3162","Chinese"=>"您的繁荣度不足，可以去商店购买更多的图腾","English"=>"Your <color=#f58c26>Prosperity</color> is not high enough. You can purchase more totems in the shop."],
5942=>["Value"=>5942,"TextKey"=>"新手引导说明3165","Chinese"=>"可花费金币购买图腾","English"=>"Spend gold to buy totems!"],
5943=>["Value"=>5943,"TextKey"=>"新手引导说明3166","Chinese"=>"每次购买后图腾都会涨价，快去收集更多的金币吧","English"=>"The price of the totems will increase after each purchase. Go get more gold!"],
5944=>["Value"=>5944,"TextKey"=>"新手引导说明2270","Chinese"=>"这是一个限时关卡，必须在有限时间内完成，否则会失败","English"=>"This level has a <color=#f58c26>Time Limit</color>. You must complete the trial in the indicated time limit, or you will lose."],
5945=>["Value"=>5945,"TextKey"=>"新手引导说明2271","Chinese"=>"以下区域记录着关卡剩余时间","English"=>"You can check how much time is left here."],
5946=>["Value"=>5946,"TextKey"=>"新手引导说明2273","Chinese"=>"随时间减少，数字颜色由“绿色”变为“黄色”，“红色”","English"=>"As the time left gets less, the color of the numbers will turn from <color=#46bb83>Green</color> to <color=#eca852>Yellow</color> and eventually <color=#e04030>Red</color>."],
5947=>["Value"=>5947,"TextKey"=>"新手引导说明2274","Chinese"=>"为了提高通关效率，可以看一下商店","English"=>"In order to beat the level faster, you can check out the Shop."],
5948=>["Value"=>5948,"TextKey"=>"新手引导说明2277","Chinese"=>"可以直接花费宝石，在商店中直接购买关键道具","English"=>"You can spend <color=#38c0a5>Rubies</color> to buy key objects from the shop directly."],
5949=>["Value"=>5949,"TextKey"=>"新手引导说明2281","Chinese"=>"此类关卡胜利可获得部落成员作为奖励，您可以花费宝石，使奖励翻倍","English"=>"This kind of levels gives you a <color=#38c0a5>Tribal Member</color> as a reward. You can spend <color=#38c0a5>Rubies</color> to double your rewards."],
5950=>["Value"=>5950,"TextKey"=>"新手引导说明2290","Chinese"=>"欢迎再次来到挑战关卡，本次通关仍会获得奖励","English"=>"Welcome to another God's Trial! You'll also get a reward after you've beat the challenge."],
5951=>["Value"=>5951,"TextKey"=>"新手引导说明2291","Chinese"=>"每个挑战关卡可以完成3次，但限时会越来越少","English"=>"You can complete a trial <color=#f58c26>three times</color>, but the time limit will get shorter each time."],
5952=>["Value"=>5952,"TextKey"=>"新手引导说明3149","Chinese"=>"英雄升级需要等待时间，也可以花费宝石加速升级","English"=>"You'll need to wait for the hero's training session for level-up, or you can spend <color=#38c0a5>Rubies</color> to speed up the process."],
5953=>["Value"=>5953,"TextKey"=>"剧情ID1","Chinese"=>"尊敬的首领大人，一路颠簸辛苦了，我们终于到达前哨之地了。我是您的斥候，特里斯坦。","English"=>"<line-height=130%>Howdy my chief! It's been a bumpy journey, we are finally here at our new <color=#f58c26>Camp</color>. I'm Tristan, your scout."],
5954=>["Value"=>5954,"TextKey"=>"剧情ID2","Chinese"=>"可真是荒芜啊，不知道这里是否有原住民呢？我们先来扎营吧！","English"=>"<line-height=130%>This is quite arid I will say…Don't know if anybody lives here? Let's start by propping up our tent!"],
5955=>["Value"=>5955,"TextKey"=>"剧情ID3","Chinese"=>"喔，感谢您我敬爱的首领大人，请允许我表达我对您的崇敬！我是您的祭司恩达。","English"=>"<line-height=130%>Oh! Immense gratitude to you my dear chief! Please allow me to show my reverence for you! I'm Enda, your humble priest."],
5956=>["Value"=>5956,"TextKey"=>"剧情ID4","Chinese"=>"现在我们已经有了遮风挡雨的地方，我们需要的是在此处建立与神的联系。","English"=>"<line-height=130%>Now that we have a shelter to protect our flesh, we need to build a spiritual connection with God. "],
5957=>["Value"=>5957,"TextKey"=>"剧情ID5","Chinese"=>"所以我恳求您建造一座祭坛，让我能够感知神的召唤。在关卡中您可以找到所需的材料。","English"=>"<line-height=130%>So, I plead to you to build an <color=#f58c26>Altar</color> for me so that I will be able to hear God's calling. You can find the materials needed in levels."],
5958=>["Value"=>5958,"TextKey"=>"剧情ID19","Chinese"=>"1…2…嗯，所有建造祭坛所需的材料都准备好了。敬爱的祭司，祭坛马上就要为您建好了。","English"=>"<line-height=130%>1...2…Hmm, all the materials we need to build the <color=#f58c26>Altar</color> are ready. Dear priest, it will be soon ready for you."],
5959=>["Value"=>5959,"TextKey"=>"剧情ID22","Chinese"=>"我感受到了神的召唤，喂~那边的小子，从现在开始不要打扰我！","English"=>"<line-height=130%>I can feel that God is calling…Hey, that young lad! Stan or something... Leave me alone, starting now!"],
5960=>["Value"=>5960,"TextKey"=>"剧情ID23","Chinese"=>"呼，祭祀大人真是吓死我了！","English"=>"<line-height=130%>Yeesh, Enda's so harsh!"],
5961=>["Value"=>5961,"TextKey"=>"剧情ID24","Chinese"=>"首领大人，剩下事情就拜托您啦！相信您一定可以取得伟大的成就！","English"=>"<line-height=130%>Chief, the rest will be on you. I believe you will be great at this~"],
5962=>["Value"=>5962,"TextKey"=>"剧情ID25","Chinese"=>"那么接下来…诶呦，什么绊了我一下，一块<color=#f58c26>祭坛</color>的【原石碎片】？干活太不利落了(扔)。","English"=>"So next…...ouch, what tripped me? Huh, I see, <color=#ef933d>A Piece of Wild Ore</color> from the <color=#f58c26>Altar</color>. You people are awfully careless when you work. *Throws the piece away*"],
5963=>["Value"=>5963,"TextKey"=>"剧情ID26","Chinese"=>"说到哪里了，喔对了，我们现在需要在营地基础上建个<color=#FF9000>仓库</color>来储藏资源。","English"=>"<line-height=130%>Where were we... Ah! We need to build a <color=#f58c26>Warehouse</color> to store resources here."],
5964=>["Value"=>5964,"TextKey"=>"剧情ID27","Chinese"=>"相应需要的东西我已经列出了，请您查看。","English"=>"<line-height=130%>I've made a list of all the materials needed. You can go check later."],
5965=>["Value"=>5965,"TextKey"=>"剧情ID28","Chinese"=>"祝您好运！","English"=>"<line-height=130%>Best of luck!"],
5966=>["Value"=>5966,"TextKey"=>"剧情ID29","Chinese"=>"既然我们的酋长已经逐渐上手了，接下来看看我们的工人能做些什么。","English"=>"<line-height=130%>Now that you are becoming more familiar with the job, let's see what our workers can do for us."],
5967=>["Value"=>5967,"TextKey"=>"剧情ID30","Chinese"=>"做得好，大人！现在我们可以更快地向家园运送物资了。","English"=>"<line-height=130%>Well done, my chief! Now we can transport resources to <color=#f58c26>Homeland</color> more efficiently."],
5968=>["Value"=>5968,"TextKey"=>"剧情ID31","Chinese"=>"（跳大神结束）创世神告诉我，我们的方向没有错。","English"=>"<line-height=130%> (finished a strange dance) Our god told me that we are heading in the right direction."],
5969=>["Value"=>5969,"TextKey"=>"剧情ID32","Chinese"=>"真的么，这可是个大消息。现在，你需要休息一会祭司大人 。","English"=>"<line-height=130%>Really? That's big news! Now what you need is rest, my dear priest."],
5970=>["Value"=>5970,"TextKey"=>"剧情ID33","Chinese"=>"（叹气）还不是时候，我得近距离的研究下这个<color=#f58c26>祭坛</color>，要是有座【桥】就好了。","English"=>"<line-height=130%>*Sighs* It's not time yet, I have to examine this <color=#f58c26>Altar</color> at a closer distance. If only we had a bridge!"],
5971=>["Value"=>5971,"TextKey"=>"剧情ID34","Chinese"=>"好吧，看来我们又有新的任务要拜托您了，年轻的首领。","English"=>"<line-height=130%>Well, it seems we have more tasks for you, my young leader."],
5972=>["Value"=>5972,"TextKey"=>"剧情ID35","Chinese"=>"为我们的<color=#f58c26>祭坛</color>修建一座<color=#f58c26>木桥</color>吧，我已经将需要做的事情给您总结好了。","English"=>"<line-height=130%>Build a <color=#f58c26>Bridge</color> for our <color=#f58c26>Altar</color>. I've put together what you need to do."],
5973=>["Value"=>5973,"TextKey"=>"剧情ID36","Chinese"=>"这么快就完成了？工人们又要有的忙了。","English"=>"<line-height=130%>How quick! More work for our workers, I see."],
5974=>["Value"=>5974,"TextKey"=>"剧情ID37","Chinese"=>"我已经等不及了！","English"=>"<line-height=130%>Amazing! I can't wait!!"],
5975=>["Value"=>5975,"TextKey"=>"剧情ID38","Chinese"=>"我听见了创世神的预言…..不像某个只会偷懒发号施令的斥候一样","English"=>"<line-height=130%>…………"],
5976=>["Value"=>5976,"TextKey"=>"剧情ID39","Chinese"=>"您已经完成了<color=#f58c26>木桥</color>的挑战了对么？那还不快放我下来！","English"=>"<line-height=130%>…………"],
5977=>["Value"=>5977,"TextKey"=>"剧情ID40","Chinese"=>"好了言归正传，正如您所见我们的营地出现了一些问题。","English"=>"<line-height=130%>Back to what we were saying, as you can see, our camp has encountered some problems."],
5978=>["Value"=>5978,"TextKey"=>"剧情ID41","Chinese"=>"我之前扔掉的原石似乎在海中爆炸了，一个八爪鱼被炸晕搁浅了。","English"=>"<line-height=130%>The <color=#ef933d>Wild Ore</color> I threw into the sea may have exploded…...so here comes a fainted octopus."],
5979=>["Value"=>5979,"TextKey"=>"剧情ID42","Chinese"=>"要知道，我正为扩大营地规模头疼呢，最近因为您的冒险我们加入了不少新成员。","English"=>"<line-height=130%>You know, I've been feeling pretty helpless about the whole <color=#f58c26>Camp Expansion situation</color>. Lots of new members joined us, you know. "],
5980=>["Value"=>5980,"TextKey"=>"剧情ID43","Chinese"=>"八爪鱼的筋膜可是制作新帐篷容纳更多成员的高级材料啊。","English"=>"<line-height=130%>The fascia of an octopus is an ideal material for making tents to accommodate more members."],
5981=>["Value"=>5981,"TextKey"=>"剧情ID44","Chinese"=>"来帮忙为更多需要休息的成员建造一片<color=#FF9000>野营地</color>吧。","English"=>"<line-height=130%>Come help build a <color=#f58c26>Camp Site</color> for members that need some rest! "],
5982=>["Value"=>5982,"TextKey"=>"剧情ID45","Chinese"=>"再攒攒材料我们就能扩大营地的规模了，看看还要些什么其他素材我们尽快完成吧。","English"=>"<line-height=130%>We will soon be ready to expand our camp even more once we've saved enough materials! Let's see what we still need and collect them ASAP!"],
5983=>["Value"=>5983,"TextKey"=>"剧情ID46","Chinese"=>"喔天哪，看看是哪个勤劳的部落领袖拯救他的人民于水火之中？就在我面前！","English"=>"<line-height=130%>Oh my, I wonder which diligent tribal leader saved the people from untold miseries? The person right in front of me!"],
5984=>["Value"=>5984,"TextKey"=>"剧情ID47","Chinese"=>"但是现在还暂时不是休息的时候，还有新加入部落的伤员在等待救治。","English"=>"<line-height=130%>But it's not the time to slack off, there are some injured members waiting to be treated."],
5985=>["Value"=>5985,"TextKey"=>"剧情ID48","Chinese"=>"我们要一个新的【草药种植园】加速他们恢复的速度，这样他们才能尽快返回我们的家园。","English"=>"<line-height=130%>We need a new <color=#f58c26>Herb Garden</color> to speed up their recovery so that they can return to us sooner."],
5986=>["Value"=>5986,"TextKey"=>"剧情ID49","Chinese"=>"已经不用我多说了吧，看看你的任务，你会知道下一步该做什么的。","English"=>"<line-height=130%>Needless to say, check out your tasks, you will know what you need to do next."],
5987=>["Value"=>5987,"TextKey"=>"剧情ID50","Chinese"=>"部落的领袖接受欢呼和称颂是必要的！在您的领导下部落必将复兴！","English"=>"<line-height=130%>A chief must accept cheers and praises! The tribe will thrive under your leadership!"],
5988=>["Value"=>5988,"TextKey"=>"剧情ID51","Chinese"=>"让我们再加把劲，就快完成营地的扩建了。","English"=>"<line-height=130%>Let's pull through! We are about to finish expanding the camp!"],
5989=>["Value"=>5989,"TextKey"=>"剧情ID52","Chinese"=>"随着您探索的地域越来越多，需要运回的战利品也变得越来越多。","English"=>"<line-height=130%>As you explore more areas, the amount of trophies we need to send back is becoming larger and larger."],
5990=>["Value"=>5990,"TextKey"=>"剧情ID53","Chinese"=>"我们现在急需一些牲畜来帮助我们运回更多战利品。","English"=>"<line-height=130%>Now we desperately need some livestock to help us carry these trophies."],
5991=>["Value"=>5991,"TextKey"=>"剧情ID54","Chinese"=>"所以我们接下来要搭建一个【牲畜棚】。","English"=>"<line-height=130%>So next we are gonna build a <color=#f58c26>Livestock Shed</color>."],
5992=>["Value"=>5992,"TextKey"=>"剧情ID55","Chinese"=>"当然如果能有一些活泼的小家伙加入我们，您完成起其他挑战来说不定也会更有干劲呢，哈哈！","English"=>"<line-height=130%>Of course, it would be brilliant if these little guys can join us! Maybe you will be even more driven to finish other challenges? "],
5993=>["Value"=>5993,"TextKey"=>"剧情ID56","Chinese"=>"多吃点多吃点，一会就要干活啦！","English"=>"<line-height=130%>Eat more, eat more! About to get moving!"],
5994=>["Value"=>5994,"TextKey"=>"剧情ID57","Chinese"=>"看起来这些小家伙马上就能派上用场了，太棒了！我们在壮大部落的路上已经开始奔跑起来了。","English"=>"<line-height=130%>It looks like these little guys will come in handy right away, fantastic! We are running full-speed to the rejuvenation of our tribe!"],
5995=>["Value"=>5995,"TextKey"=>"剧情ID58","Chinese"=>"我这里还有最后一个挑战需要您协助完成。","English"=>"<line-height=130%>I have a last challege here that needs your assistance."],
5996=>["Value"=>5996,"TextKey"=>"剧情ID59","Chinese"=>"为了防止我们离开后建立好的营地被破坏，我们需要一支专业能力过硬的斥候小队。","English"=>"<line-height=130%>In case some ill-intentioned ones come ruin our camp once we've left, we need a professional scouts team to protect our work here."],
5997=>["Value"=>5997,"TextKey"=>"剧情ID60","Chinese"=>"他们会来回不间断地进行巡逻，所以这边需要建一个【训练场】才行。","English"=>"<line-height=130%>They will patrol this area non-stop, so we will need to build a <color=#f58c26>Training Ring</color> here."],
5998=>["Value"=>5998,"TextKey"=>"剧情ID61","Chinese"=>"这片区域您已经探索了很大一部分了，这个设施的建造势在必行。","English"=>"<line-height=130%>You've explored a great portion of this area, hence the construction of this facility is imperative."],
5999=>["Value"=>5999,"TextKey"=>"剧情ID62","Chinese"=>"请您查阅详细的信息，已经为您标出了。","English"=>"<line-height=130%>Please check the detailed information, which has been marked for you."],
6000=>["Value"=>6000,"TextKey"=>"剧情ID63","Chinese"=>"终于快弄完了！完事后要好好庆祝一下。","English"=>"<line-height=130%>We're almost done! We must celebrate afterwards."],
6001=>["Value"=>6001,"TextKey"=>"剧情ID64","Chinese"=>"万岁！加油干！","English"=>"<line-height=130%>Hooray! Work hard! "],
6002=>["Value"=>6002,"TextKey"=>"剧情ID65","Chinese"=>"不要这么急着庆祝，吵吵闹闹的打乱了我的冥想。","English"=>"<line-height=130%>Don't celebrate yet! I can't concentrate when you are this clamorous!"],
6003=>["Value"=>6003,"TextKey"=>"剧情ID66","Chinese"=>"我刚刚想进一步探究一下神器是什么，就被你们这群聒噪的刺头搅了！","English"=>"<line-height=130%>I was trying to figure out what that artifact was and was ruined by you noisy idiots!"],
6004=>["Value"=>6004,"TextKey"=>"剧情ID67","Chinese"=>"收起来！收起来！","English"=>"<line-height=130%>Clean it up! Take these away!"],
6005=>["Value"=>6005,"TextKey"=>"剧情ID68","Chinese"=>"我要一个【强大的符文底座】再进行一次占卜。","English"=>"<line-height=130%>I will need a <color=#f58c26>Powerful Rune Base</color> to speak to the gods again."],
6006=>["Value"=>6006,"TextKey"=>"剧情ID69","Chinese"=>"想办法搞清楚我们追寻的神器到底是个什么玩意。","English"=>"<line-height=130%>So that I can finally figure out what the heck this artifact we are looking for is."],
6007=>["Value"=>6007,"TextKey"=>"剧情ID70","Chinese"=>"天哪！","English"=>"<line-height=130%>Oh!"],
6008=>["Value"=>6008,"TextKey"=>"剧情ID71","Chinese"=>"别磨磨蹭蹭的，要知道部落的复兴全靠它了。都去干活！","English"=>"<line-height=130%>Stop dawdling. You should know our tribe's future depends on it. Get to work!"],
6009=>["Value"=>6009,"TextKey"=>"剧情ID72","Chinese"=>"祭司的起床气有点严重，看来庆祝只能推迟了。","English"=>"<line-height=130%>The priest probably got up on the wrong side of the bed. I guess we will have to postpone the celebration."],
6010=>["Value"=>6010,"TextKey"=>"剧情ID73","Chinese"=>"不错，不错。有了它我就能事半功倍了。我已经迫不及待要开始了(走向祭坛开始跳大神)","English"=>"<line-height=130%>Nice, nice! Everything will be much easier now that I have this. I can't wait to get started! *Walks to the altar and starts to dance*"],
6011=>["Value"=>6011,"TextKey"=>"剧情ID74","Chinese"=>"(施法的鸟语…)","English"=>"<line-height=130%>*Speaking gibberish*"],
6012=>["Value"=>6012,"TextKey"=>"剧情ID75","Chinese"=>"我的天哪！那是...那是！那竟然是“大地之心”啊！","English"=>"<line-height=130%>Oh dear, that's…...that's the <color=#f58c26>Heart of the Earth</color>!"],
6013=>["Value"=>6013,"TextKey"=>"剧情ID76","Chinese"=>"那璀璨纯净的光芒，它一定能够帮助我们振兴部落的！","English"=>"<line-height=130%>That pure radiance……It can definitely help the tribe thrive!"],
6014=>["Value"=>6014,"TextKey"=>"剧情ID77","Chinese"=>"这真是个令人振奋的消息！好吧，终于是时候好好庆祝一下了！闹腾起来吧朋友们！","English"=>"<line-height=130%>That's thrilling to hear. Great, time to celebrate, folks!"],
6015=>["Value"=>6015,"TextKey"=>"剧情ID78","Chinese"=>"不要着急小伙子们！就快到了……","English"=>"<line-height=130%>Don't rush boys, we are almost there……"],
6016=>["Value"=>6016,"TextKey"=>"剧情ID79","Chinese"=>"创世神保佑！已经在沙漠里走了好久了，或者再给我点水喝也行。","English"=>"<line-height=130%>God bless! We've been walking in the desert for days, or maybe you can give me some water? "],
6017=>["Value"=>6017,"TextKey"=>"剧情ID80","Chinese"=>"有点耐心！我在你们这么大的时候……这是什么？","English"=>"<line-height=130%>Have some patience! When I was your age…….Wait, what is this?"],
6018=>["Value"=>6018,"TextKey"=>"剧情ID81","Chinese"=>"哇啊啊啊啊啊啊——","English"=>"<line-height=130%>WOAAAAAAH!"],
6019=>["Value"=>6019,"TextKey"=>"剧情ID82","Chinese"=>"祭司大人？！","English"=>"<line-height=130%>Priest?!"],
6020=>["Value"=>6020,"TextKey"=>"剧情ID83","Chinese"=>"喔！天哪祭祀大人您在下边嘛！还好吗？","English"=>"<line-height=130%>Oh no, are you down there my priest? Are you ok?"],
6021=>["Value"=>6021,"TextKey"=>"剧情ID84","Chinese"=>"我……我还算活着，我被这个….像是天然魔法矿洞的玩意卷下来了…...","English"=>"<line-height=130%>Well……I guess I'm still alive……Hmm, I think I was dragged down by this…..natural magical mine?"],
6022=>["Value"=>6022,"TextKey"=>"剧情ID85","Chinese"=>"谢天谢地！您没事就好，您别着急，我们想办法救您出来。","English"=>"<line-height=130%>Oh thank God you are fine, don't worry, we will soon get you out of there."],
6023=>["Value"=>6023,"TextKey"=>"剧情ID86","Chinese"=>"看来是没戏了，天也不早了。","English"=>"<line-height=130%>There appears to be no luck, and the sky is turning dark."],
6024=>["Value"=>6024,"TextKey"=>"剧情ID87","Chinese"=>"只能暂时收集附近的材料先建立一个<color=#FF9000>营地</color>，休息之后再做打算。","English"=>"<line-height=130%>All we can do for now is to gather some materials and build a <color=#f58c26>Camp</color>, and try to figure this out after we have some rest."],
6025=>["Value"=>6025,"TextKey"=>"剧情ID88","Chinese"=>"需要的东西我已经罗列出来了，请您查看。","English"=>"<line-height=130%>I've listed all the things we need, please go check."],
6026=>["Value"=>6026,"TextKey"=>"剧情ID89","Chinese"=>"您还好么祭司大人？","English"=>"<line-height=130%>Are you ok, my priest?"],
6027=>["Value"=>6027,"TextKey"=>"剧情ID90","Chinese"=>"有功夫问还不如想办法让我出去！","English"=>"<line-height=130%>I would apprecite it if you spend your energy on getting me out of here instead of asking me if I'm ok!"],
6028=>["Value"=>6028,"TextKey"=>"剧情ID91","Chinese"=>"就好了，我还有些必要救援工具需要完成，还请您稍安勿躁(笑)","English"=>"<line-height=130%>Almost there, I still have some necessary rescue tools that I need before proceeding. Please stay calm. *Smiles*"],
6029=>["Value"=>6029,"TextKey"=>"剧情ID92","Chinese"=>"在酋长您搜罗扎营素材的时候，我在附近的制高点找到了一个废弃的建筑，似乎是个【旧工坊】。","English"=>"<line-height=130%>My chief, when you were gathering materials for the camp, I found an abandoned building on a hill-top nearby. It appears to be an <color=#f58c26>Old Workshop</color>."],
6030=>["Value"=>6030,"TextKey"=>"剧情ID93","Chinese"=>"我在里面发现了一个很大的草绳机，但是已经坏得七零八落了。","English"=>"<line-height=130%>I found a big straw rope machine inside, but it's all a hideous mess."],
6031=>["Value"=>6031,"TextKey"=>"剧情ID94","Chinese"=>"我们可以翻新这个【旧工坊】，这样我们就能做出绳子拉祭司大人出来了。","English"=>"<line-height=130%>We can renovate the <color=#f58c26>Old Workshop</color>, so that we can make a rope and pull the priest out."],
6032=>["Value"=>6032,"TextKey"=>"剧情ID95","Chinese"=>"如果不知道要什么的话查一下我帮您总结的任务就好，静候您归来。","English"=>"<line-height=130%>If you don't know what we need, you can check the tasks I summarized for you. I will be waiting here."],
6033=>["Value"=>6033,"TextKey"=>"剧情ID96","Chinese"=>"草绳机已经可以使用了，真好。","English"=>"<line-height=130%>The straw rope machine is up and running, great job!"],
6034=>["Value"=>6034,"TextKey"=>"剧情ID97","Chinese"=>"一点也不好！快拉我上去！马上，立刻！","English"=>"<line-height=130%>Not great at all! Pull me up! Right now, immediately!"],
6035=>["Value"=>6035,"TextKey"=>"剧情ID98","Chinese"=>"就差最后一步了，只要把草绳和吊车的材料准备好就可以救您老人家出来了。","English"=>"<line-height=130%>There's only one step left. We only need to prepare the straw rope and the crane before we can fish you out."],
6036=>["Value"=>6036,"TextKey"=>"剧情ID99","Chinese"=>"任务已经列出，快出发吧。(笑)","English"=>"<line-height=130%>Tasks are listed, go ahead! *Smiles*"],
6037=>["Value"=>6037,"TextKey"=>"剧情ID100","Chinese"=>"诶——我总觉得你是故意的……呜呜……","English"=>"<line-height=130%>I feel you are targeting me……*Tears Up*"],
6038=>["Value"=>6038,"TextKey"=>"剧情ID101","Chinese"=>"祭司大人，营救人员已经下去了，请确保站在显眼的地方，不要被他们踩……","English"=>"<line-height=130%>Dear priest, the rescue team is down, please make yourself visible so that you won't be stepped on……"],
6039=>["Value"=>6039,"TextKey"=>"剧情ID102","Chinese"=>"你踩到我的腰了！轻点，轻点……","English"=>"<line-height=130%>You are standing on top of me! Get off me! "],
6040=>["Value"=>6040,"TextKey"=>"剧情ID103","Chinese"=>"看样子祭司大人马上就能上来了，做得好。","English"=>"<line-height=130%>It looks like the priest will be up soon, well done."],
6041=>["Value"=>6041,"TextKey"=>"剧情ID104","Chinese"=>"趁着我们能下【矿井】了，您需要再在周围收集一些开采工具的材料。","English"=>"<line-height=130%>Now that we can go into the <color=#f58c26>Mine</color>, all you need is some materials to make excavation tools."],
6042=>["Value"=>6042,"TextKey"=>"剧情ID105","Chinese"=>"没准我们能从这个奇怪的矿井里找到些什么好东西。","English"=>"<line-height=130%>Maybe we can find some good stuff in this weird mine!"],
6043=>["Value"=>6043,"TextKey"=>"剧情ID106","Chinese"=>"请您在给您总结好的任务列表查看需要的材料。","English"=>"<line-height=130%>Please refer to the list of tasks that I made for you for the material needed."],
6044=>["Value"=>6044,"TextKey"=>"剧情ID107","Chinese"=>"拿好，如果光源灭掉了就不要再往深了走了，好么。","English"=>"<line-height=130%>Hold this, and if the fire goes out, don't keep going, ok?"],
6045=>["Value"=>6045,"TextKey"=>"剧情ID108","Chinese"=>"加油吧各位，为了部落！","English"=>"<line-height=130%>You can do this, for the tribe!"],
6046=>["Value"=>6046,"TextKey"=>"剧情ID109","Chinese"=>"喔，是你呀。我已经等不及想看看他们能带来些什么。","English"=>"<line-height=130%>Oh it's you, chief! I can't wait what they can bring to us,"],
6047=>["Value"=>6047,"TextKey"=>"剧情ID110","Chinese"=>"所以先发了工具让他们先干起来。","English"=>"<line-height=130%>So I gave them tools and had them started."],
6048=>["Value"=>6048,"TextKey"=>"剧情ID111","Chinese"=>"天哪，那是什么？","English"=>"<line-height=130%>Oh my lord what is that?"],
6049=>["Value"=>6049,"TextKey"=>"剧情ID112","Chinese"=>"是暗河！下矿的成员竟然打通了一条地下【暗河】，这下我们有水喝了。","English"=>"<line-height=130%>It's an underground river! I can't believe our team found an <color=#f58c26>Underground River</color>! Now we have water."],
6050=>["Value"=>6050,"TextKey"=>"剧情ID113","Chinese"=>"看来听了祭司的占卜在这儿建成一个新营地的想法真的不错。","English"=>"<line-height=130%>I'm glad we listened to the priest's divination to build a new camp here."],
6051=>["Value"=>6051,"TextKey"=>"剧情ID114","Chinese"=>"让我们再来完善一下这里的其他设施吧。","English"=>"<line-height=130%>Let's build some more infrastructure here!"],
6052=>["Value"=>6052,"TextKey"=>"剧情ID115","Chinese"=>"就像其他营地一样，这里也需要一个临时的<color=#FF9000>仓库</color>来贮存东西。","English"=>"<line-height=130%>Just like the other camps, we also need a temporary <color=#f58c26>Warehouse</color> to store our stuff!"],
6053=>["Value"=>6053,"TextKey"=>"剧情ID116","Chinese"=>"我们的下一步就按照任务来做吧。","English"=>"<line-height=130%>Our next step will be following the task list."],
6054=>["Value"=>6054,"TextKey"=>"剧情ID117","Chinese"=>"哦。","English"=>"<line-height=130%>Okay."],
6055=>["Value"=>6055,"TextKey"=>"剧情ID118","Chinese"=>"感谢我的占卜找到了水源吧！好了，我已经准备好了。","English"=>"<line-height=130%>Thank me for leading you to water! Alright, I'm ready."],
6056=>["Value"=>6056,"TextKey"=>"剧情ID119","Chinese"=>"要进行下一次占卜了，这次我要一座【瞭望塔】试试用星空占卜。","English"=>"<line-height=130%>I'm gonna talk to the gods again. This time I need a <color=#f58c26>Watchtower</color> to try out Astrology. "],
6057=>["Value"=>6057,"TextKey"=>"剧情ID120","Chinese"=>"可是…...","English"=>"<line-height=130%>But……"],
6058=>["Value"=>6058,"TextKey"=>"剧情ID121","Chinese"=>"我们已经没时间了，要完成的任务多着呢。","English"=>"<line-height=130%>We have no time left! We have tons of work to do!"],
6059=>["Value"=>6059,"TextKey"=>"剧情ID122","Chinese"=>"那边那个怠慢我的年轻人，你也快点动起来！","English"=>"<line-height=130%>That rude young man over there, get moving!"],
6060=>["Value"=>6060,"TextKey"=>"剧情ID123","Chinese"=>"所以我小的时候大人们要我不要招惹难缠的老人，我为什么不听呢……","English"=>"<line-height=130%>Adults told me not to mess with the elders, why did I never listen……"],
6061=>["Value"=>6061,"TextKey"=>"剧情ID124","Chinese"=>"好了大人，我现在要去占卜一下了。","English"=>"<line-height=130%>Ok my chief, I'm gonna go talk to the gods."],
6062=>["Value"=>6062,"TextKey"=>"剧情ID125","Chinese"=>"您也可以暂时放松一下，待会见。","English"=>"<line-height=130%>You can chill for a sec, see you in a bit."],
6063=>["Value"=>6063,"TextKey"=>"剧情ID126","Chinese"=>"(小声)这边……首领大人……","English"=>"<line-height=130%>*Whispers* Over here……our leader……"],
6064=>["Value"=>6064,"TextKey"=>"剧情ID127","Chinese"=>"看来老人家可以暂时消停一会了。","English"=>"<line-height=130%>That old man can finally stop for a moment."],
6065=>["Value"=>6065,"TextKey"=>"剧情ID128","Chinese"=>"我们在矿洞采集的成员发现一枚闪闪发光的种子。","English"=>"<line-height=130%>Our team found a shining seed down there in the mine."],
6066=>["Value"=>6066,"TextKey"=>"剧情ID129","Chinese"=>"我们准备把它种下看看能种出什么东西来，所以来拜托您。","English"=>"<line-height=130%>We are thinking of planting it to see what it may grow into. So we are here seeking for your help."],
6067=>["Value"=>6067,"TextKey"=>"剧情ID130","Chinese"=>"您愿意趁现在帮助我们收集一些处理土壤的材料么？","English"=>"<line-height=130%>Do you mind collecting some materials for processing the soil?"],
6068=>["Value"=>6068,"TextKey"=>"剧情ID131","Chinese"=>"任务我已经整理好啦，请您查看。","English"=>"<line-height=130%>I've summarized the task list for you, please check it out."],
6069=>["Value"=>6069,"TextKey"=>"剧情ID132","Chinese"=>"我从来没见过这种奇怪的植物，它看起来，似乎很好吃的样子……","English"=>"<line-height=130%>I've never seen this kind of strange plant before. It looks rather tasty……"],
6070=>["Value"=>6070,"TextKey"=>"剧情ID133","Chinese"=>"你们都在这干什么？这是……","English"=>"<line-height=130%>What are you doing over here? And this is……"],
6071=>["Value"=>6071,"TextKey"=>"剧情ID134","Chinese"=>"看来我的占卜没错，我们需要取这个【多肉植物】的一部分来做个【供奉箱】。","English"=>"<line-height=130%>It appears that my divination was accurate. We need to take a bit of this <color=#ef933d>Succulent</color> to make an <color=#f58c26>Offering Chest</color>."],
6072=>["Value"=>6072,"TextKey"=>"剧情ID135","Chinese"=>"哈？","English"=>"<line-height=130%>Huh?"],
6073=>["Value"=>6073,"TextKey"=>"剧情ID136","Chinese"=>"提前做好会帮助我们满载而归的，嗯嗯~","English"=>"<line-height=130%>Finishing it early will help us get loads of rewards!"],
6074=>["Value"=>6074,"TextKey"=>"剧情ID137","Chinese"=>"虽然不清楚老祭司在说什么，但是还是现在准备材料吧。","English"=>"<line-height=130%>Although I'm not sure what he's talking about, but let's prepare the materials right now."],
6075=>["Value"=>6075,"TextKey"=>"剧情ID138","Chinese"=>"任务我会给您总结好的，加油吧。","English"=>"<line-height=130%>I'll summarize the task for you. Work hard!"],
6076=>["Value"=>6076,"TextKey"=>"剧情ID139","Chinese"=>"时机到了，快把做好的供奉箱摆上。","English"=>"<line-height=130%>It's time, put the <color=#f58c26>Offering Chest</color> there."],
6077=>["Value"=>6077,"TextKey"=>"剧情ID140","Chinese"=>"料事如神啊简直，这一英灵的加入一定能帮助到部落的建设。","English"=>"<line-height=130%>Your prophecies are miraculously accurate. The hero's company will definitely help our tribe thrive."],
6078=>["Value"=>6078,"TextKey"=>"剧情ID141","Chinese"=>"对老人家好一点还是很受用的，好了现在准备打包跟着我继续往前走吧，神器离我们原来越近了~","English"=>"<line-height=130%>It can be really useful sometimes to treat old people nicely. Now, pack up your stuff and follow me. The artifact is closer and closer to us!"],
6079=>["Value"=>6079,"TextKey"=>"剧情ID142","Chinese"=>"您说的没错(笑)，大家打包准备出发，我们下个营地见，酋长大人。","English"=>"<line-height=130%>You are right, let's pack up and get moving. We will see you at the next <color=#f58c26>Camp</color>, my priest."],
6080=>["Value"=>6080,"TextKey"=>"剧情ID143","Chinese"=>"是谁打扰了大德鲁伊的休息！！！","English"=>"<line-height=130%>Who disturbed my slumber?!"],
6081=>["Value"=>6081,"TextKey"=>"剧情ID144","Chinese"=>"怎么了？是谁？","English"=>"<line-height=130%>What? Who's there?"],
6082=>["Value"=>6082,"TextKey"=>"剧情ID145","Chinese"=>"谁在那里？","English"=>"<line-height=130%>Who's there?"],
6083=>["Value"=>6083,"TextKey"=>"剧情ID146","Chinese"=>"我乃大德鲁伊，吟游诗人之祖，狂风的征服者，冒险家的守护者，令人战栗的神使，神谕代行者，歌唱的阿梅金！","English"=>"<line-height=130%>I'm the archdruid, father of bards, conquer of storm, protector of all adverturers, God's terrifying messenger, executor of God's words, the chanting Amergin! "],
6084=>["Value"=>6084,"TextKey"=>"剧情ID147","Chinese"=>"这里竟然能有大德鲁伊？别逗笑我了…...","English"=>"<line-height=130%>Stop kidding, no way an archdruid lives here!"],
6085=>["Value"=>6085,"TextKey"=>"剧情ID148","Chinese"=>"糊涂的祭司！我协助冒险者后在这螺壳中休息，轻视我等自然之力的使者将自食其果！","English"=>"Foolish priest! I'm just taking a break from my destiny of aiding adventurers, and I happened to find this shell that suits my purpose. Who looks down on us agents of nature will pay their price!"],
6086=>["Value"=>6086,"TextKey"=>"剧情ID149","Chinese"=>"真的是呼风唤雨的大德鲁伊，我等部族来此追寻预兆寻找大地之心。","English"=>"<line-height=130%>I can't believe my eyes! This is trully the mighty archdruid! We are here to seek the 'Heart of the Earth' following messages from the gods."],
6087=>["Value"=>6087,"TextKey"=>"剧情ID150","Chinese"=>"对您完全没有不敬之意，还请您祝我们这些冒险者一臂之力。","English"=>"<line-height=130%>I'm extremely sorry for my ignorance and stupidity and I hope you are still willing to lend us adventurers a hand."],
6088=>["Value"=>6088,"TextKey"=>"剧情ID151","Chinese"=>"大地之心？哈哈，那我定将助你们一臂之力。","English"=>"<line-height=130%><color=#f58c26>Heart of the Earth</color>? Interesting, I will help you, you have my words."],
6089=>["Value"=>6089,"TextKey"=>"剧情ID152","Chinese"=>"还请您移步我们的部落，我们共同商议。","English"=>"<line-height=130%>Fantastic! Please follow us to our tribal Homeland where we can deliberate."],
6090=>["Value"=>6090,"TextKey"=>"剧情ID153","Chinese"=>"您终于完成了任务，八爪鱼正好刚刚处理完成了，工人这就开始建造啦。","English"=>"<line-height=130%>You finally finished the task! We just finished handling the octopus, and now the workers will get to work!"],
6091=>["Value"=>6091,"TextKey"=>"剧情ID154","Chinese"=>"什么，人手不够用了？那边砍柴的工人，先来这里帮忙草药园的建设吧，伤员恢复人手多起来情况就会好很多了。","English"=>"What? Not enough workers? Hey you guys over there, come help out with the construction of the <color=#f58c26>Herb Garden</color>. Things will be much easier once the wounded are treated!"],
6092=>["Value"=>6092,"TextKey"=>"剧情ID155","Chinese"=>"摆弄花草？听起来很轻松，这就来。","English"=>"<line-height=130%>Tending plants? Sounds easy, coming!"],
6093=>["Value"=>6093,"TextKey"=>"剧情ID156","Chinese"=>"准备好了么？","English"=>"<line-height=130%>Are you ready?"],
6094=>["Value"=>6094,"TextKey"=>"剧情ID157","Chinese"=>"准备好了先生！","English"=>"<line-height=130%>Yes sir!"],
6095=>["Value"=>6095,"TextKey"=>"剧情ID158","Chinese"=>"我们的首领也准备好了素材，那就快开始吧！","English"=>"<line-height=130%>Our leader has finished preparing the materials, then let's get started!"],
6096=>["Value"=>6096,"TextKey"=>"剧情ID159","Chinese"=>"好的先生！没问题先生！","English"=>"<line-height=130%>Yes sir! No problem sir!"],
6097=>["Value"=>6097,"TextKey"=>"剧情ID160","Chinese"=>"为什么我们还有没完没了班要加…..","English"=>"<line-height=130%>Why do we have endless amount of work to do……"],
6098=>["Value"=>6098,"TextKey"=>"剧情ID161","Chinese"=>"不要抱怨个没完，等我做完最后的占卜，你就可以随便去什么地方休假了。","English"=>"<line-height=130%>Stop complaining, after my last divination, you can go take a vacation at wherever you want."],
6099=>["Value"=>6099,"TextKey"=>"剧情ID162","Chinese"=>"但愿你说的是真的，先生。","English"=>"<line-height=130%>I hope what you say is true, sir."],
6100=>["Value"=>6100,"TextKey"=>"剧情ID163","Chinese"=>"好的看来您是完成了，这样我们今晚至少能挨过去，要知道沙漠晚上可是会冻死人的。","English"=>"<line-height=130%>Ok it looks like the job is done, so at least we can survive the night. You know how cold it can get in desert at night-time…"],
6101=>["Value"=>6101,"TextKey"=>"剧情ID164","Chinese"=>"大家都很疲惫，还是我来秀一手丰富的扎营技术吧。","English"=>"<line-height=130%>Everyone is tired, I say let me show you how an expert sets up a tent."],
6102=>["Value"=>6102,"TextKey"=>"剧情ID165","Chinese"=>"酋长大人，这就收集好了？没事没事，您慢一点来也没关系的，祭司不在我们呆的很消停安逸…...","English"=>"<line-height=130%>My chief, you've already finished collecting the materials? It's okay to take your time, 'cauze since the priest is not here, we are enjoying our quiet and peaceful time……"],
6103=>["Value"=>6103,"TextKey"=>"剧情ID166","Chinese"=>"我还是能听到的，你这样真的好嘛…...","English"=>"<line-height=130%>I can still hear you! It's not okay!"],
6104=>["Value"=>6104,"TextKey"=>"剧情ID167","Chinese"=>"开个小玩笑呀祭司大人，好了，吊绳就好了。","English"=>"<line-height=130%>Just joking! Ok, the lifting rope is ready."],
6105=>["Value"=>6105,"TextKey"=>"剧情ID168","Chinese"=>"酋长回来了？您将战利品交给我就好，金库马上就好。","English"=>"<line-height=130%>The chief is back? I'll take care of the trophies, the vault will be ready in a minute."],
6106=>["Value"=>6106,"TextKey"=>"剧情ID169","Chinese"=>"好的，酋长您这边也完成了，剩下就是祭司指名让我完成的瞭望塔了。","English"=>"<line-height=130%>Ok my chief, you have finished your work, and the only thing left is the <color=#f58c26>Watchtower</color> that the priest asked me to build……"],
6107=>["Value"=>6107,"TextKey"=>"剧情ID170","Chinese"=>"我听得见，你这个臭小子，别想埋怨，快点干。","English"=>"<line-height=130%>I can hear you you punk! Stop complaining and do your job!"],
6108=>["Value"=>6108,"TextKey"=>"剧情ID171","Chinese"=>"好的~好的~诶…...","English"=>"<line-height=130%>Ok~ok~*Sighs*"],
6109=>["Value"=>6109,"TextKey"=>"剧情ID172","Chinese"=>"这是…..哪里飞来的箭？","English"=>"<line-height=130%>What……where did this arrow come from?"],
6110=>["Value"=>6110,"TextKey"=>"剧情ID173","Chinese"=>"不想被闪电化成齑粉的话就别动它。","English"=>"<line-height=130%>Don't touch it if you don't want to be burnt to dust by lightening."],
6111=>["Value"=>6111,"TextKey"=>"剧情ID174","Chinese"=>"雷电之女果然来了，赞美您特拉齐嘉！","English"=>"<line-height=130%>Just like how I expected! You are here, praise you, the daughter of thunder, Tlachtga!"],
6112=>["Value"=>6112,"TextKey"=>"剧情ID175","Chinese"=>"一名祭司？你有什么事情么？","English"=>"<line-height=130%>A priest? What's the matter?"],
6113=>["Value"=>6113,"TextKey"=>"剧情ID176","Chinese"=>"我占卜到作为半神的您会经过这里，便准备了供奉箱向您献祭。","English"=>"<line-height=130%>I fortold that you, a demi-god, will pass through here, so we prepared an offering box for you."],
6114=>["Value"=>6114,"TextKey"=>"剧情ID177","Chinese"=>"希望借用您的力量来帮助我们，找寻神器，复兴部落。","English"=>"<line-height=130%>I hope you can lend your power to our quest searching for an artifact that can rejuvenate our tribe."],
6115=>["Value"=>6115,"TextKey"=>"剧情ID178","Chinese"=>"既然你等如此诚心，那我就收下你的供奉助你一臂之力吧. 好了你们的家园在哪里，我要先飞去了，希望那里有张舒服的床…...","English"=>"In this case, given your sincerity, I will accept your offer and lend you a hand. Ok, where is your home? I will head there now. I hope there's a comfortable bed……"],
6116=>["Value"=>6116,"TextKey"=>"剧情ID179","Chinese"=>"太好了！","English"=>"<line-height=130%>Amazing!"],
6117=>["Value"=>6117,"TextKey"=>"剧情ID180","Chinese"=>"不要磨磨蹭蹭的，首领和我都在等着你呢！","English"=>"<line-height=130%>Stop dawdling. Chief and I are waiting for you!"],
6118=>["Value"=>6118,"TextKey"=>"剧情ID181","Chinese"=>"好的。","English"=>"<line-height=130%>Alright then."],
6119=>["Value"=>6119,"TextKey"=>"剧情ID182","Chinese"=>"0","English"=>"<line-height=130%>Hey you!"],
6120=>["Value"=>6120,"TextKey"=>"剧情ID183","Chinese"=>"0","English"=>"Yes?"],
6121=>["Value"=>6121,"TextKey"=>"剧情ID184","Chinese"=>"0","English"=>"*Don't Respond*"],
6122=>["Value"=>6122,"TextKey"=>"剧情ID185","Chinese"=>"0","English"=>"Stop pretending, I smell you."],
6123=>["Value"=>6123,"TextKey"=>"剧情ID186","Chinese"=>"0","English"=>"Me?"],
6124=>["Value"=>6124,"TextKey"=>"剧情ID187","Chinese"=>"0","English"=>"Yes! You. Do you mind lending an old lady a hand?"],
6125=>["Value"=>6125,"TextKey"=>"剧情ID188","Chinese"=>"0","English"=>"Err…I'm not really here."],
6126=>["Value"=>6126,"TextKey"=>"剧情ID189","Chinese"=>"0","English"=>"Huh, and why is that?"],
6127=>["Value"=>6127,"TextKey"=>"剧情ID190","Chinese"=>"0","English"=>"I'm with the people of my tribe right now, and we are on a journey in search for the tribal artifact."],
6128=>["Value"=>6128,"TextKey"=>"剧情ID191","Chinese"=>"0","English"=>"I see. I'm actually talking to you, the you holding that little glowing block?"],
6129=>["Value"=>6129,"TextKey"=>"剧情ID192","Chinese"=>"0","English"=>"My……phone?"],
6130=>["Value"=>6130,"TextKey"=>"剧情ID193","Chinese"=>"0","English"=>"Yes exactly. The "my phone". Would you help me?"],
6131=>["Value"=>6131,"TextKey"=>"剧情ID194","Chinese"=>"0","English"=>"What do you need help for?"],
6132=>["Value"=>6132,"TextKey"=>"剧情ID195","Chinese"=>"0","English"=>"Wait……Why can you *smell* me?"],
6133=>["Value"=>6133,"TextKey"=>"剧情ID196","Chinese"=>"0","English"=>"Oh sweetie although I have one blind eye, I can still sense everything. You'll understand later. Now, would you help me?"],
6134=>["Value"=>6134,"TextKey"=>"剧情ID197","Chinese"=>"0","English"=>"Ok. What do you need?"],
6135=>["Value"=>6135,"TextKey"=>"剧情ID198","Chinese"=>"0","English"=>"Your tribe is gonna pass by rihgt? So how about we trick them, like pretending I'm someone else, you know?"],
6136=>["Value"=>6136,"TextKey"=>"剧情ID199","Chinese"=>"0","English"=>"Why?"],
6137=>["Value"=>6137,"TextKey"=>"剧情ID200","Chinese"=>"0","English"=>"I pretend I'm in desperate need of food, and prop up a tiny booth over there, and carve "Starving, please buy my things, give food please" on the front desk. OMG, marvelous plan!"],
6138=>["Value"=>6138,"TextKey"=>"剧情ID201","Chinese"=>"0","English"=>"I don't get it……"],
6139=>["Value"=>6139,"TextKey"=>"剧情ID202","Chinese"=>"0","English"=>"I don't wanna help some random rude people, right? You gotta be nice to get my help."],
6140=>["Value"=>6140,"TextKey"=>"剧情ID203","Chinese"=>"0","English"=>"So?"],
6141=>["Value"=>6141,"TextKey"=>"剧情ID204","Chinese"=>"0","English"=>"If they buy my stuff and give me food, they are OK. Or give me food directly, even better!"],
6142=>["Value"=>6142,"TextKey"=>"剧情ID205","Chinese"=>"0","English"=>"Otherwise? A finger snap and your tribe will be no more. Got it? So go gather some materials for me!"],
6143=>["Value"=>6143,"TextKey"=>"剧情ID206","Chinese"=>"0","English"=>"You' ve got all I asked from you. Amazing! Sweeties, go prop up my booth right now!"],
6144=>["Value"=>6144,"TextKey"=>"剧情ID207","Chinese"=>"0","English"=>"Amazing! Thank y' all so much! "],
6145=>["Value"=>6145,"TextKey"=>"剧情ID208","Chinese"=>"0","English"=>"I hope my daughter is as reliable and efficient as you. "],
6146=>["Value"=>6146,"TextKey"=>"剧情ID209","Chinese"=>"0","English"=>"We got separated earlier in the desert, and I got lost…...My sense of direction is not that great. "],
6147=>["Value"=>6147,"TextKey"=>"剧情ID210","Chinese"=>"0","English"=>"Do you know where she is now?"],
6148=>["Value"=>6148,"TextKey"=>"剧情ID211","Chinese"=>"0","English"=>"Of course I know where she is! But she can't just…not look for me! "],
6149=>["Value"=>6149,"TextKey"=>"剧情ID212","Chinese"=>"0","English"=>"I mean, she can at least send a lightning or something!"],
6150=>["Value"=>6150,"TextKey"=>"剧情ID213","Chinese"=>"0","English"=>"This feels nice. You know? Just you and me, chilling, having a little chat, spilling some tea…"],
6151=>["Value"=>6151,"TextKey"=>"剧情ID214","Chinese"=>"0","English"=>"They are coming. We just need to wait."],
6152=>["Value"=>6152,"TextKey"=>"剧情ID215","Chinese"=>"0","English"=>"……"],
6153=>["Value"=>6153,"TextKey"=>"剧情ID216","Chinese"=>"0","English"=>"……………"],
6154=>["Value"=>6154,"TextKey"=>"剧情ID217","Chinese"=>"0","English"=>"……………………"],
6155=>["Value"=>6155,"TextKey"=>"剧情ID218","Chinese"=>"0","English"=>"Ok! You! Go back!"],
6156=>["Value"=>6156,"TextKey"=>"剧情ID219","Chinese"=>"0","English"=>"I'm gonna go climb on those bones and check where they are."],
6157=>["Value"=>6157,"TextKey"=>"剧情ID220","Chinese"=>"0","English"=>"Hmm…I don't see them…"],
6158=>["Value"=>6158,"TextKey"=>"剧情ID221","Chinese"=>"0","English"=>"Wait! I think I see them now."],
6159=>["Value"=>6159,"TextKey"=>"剧情ID222","Chinese"=>"0","English"=>"Wow, that little priest of yours is REALLY cute!"],
6160=>["Value"=>6160,"TextKey"=>"剧情ID223","Chinese"=>"0","English"=>"Oh oh and is that you? Wearing a necklace made of tiger teeth? Nice. Aren't you a little tough chief!"],
6161=>["Value"=>6161,"TextKey"=>"剧情ID224","Chinese"=>"0","English"=>"Alright they will be here in no time. I can't wait to meet your people! Now, I just need to come down carefully……"],
6162=>["Value"=>6162,"TextKey"=>"剧情ID225","Chinese"=>"0","English"=>"Are you alright?"],
6163=>["Value"=>6163,"TextKey"=>"剧情ID226","Chinese"=>"0","English"=>"Hello?"],
6164=>["Value"=>6164,"TextKey"=>"剧情ID227","Chinese"=>"0","English"=>""Starving, please buy things, give food please." Huh. Looks like someone started a little business here."],
6165=>["Value"=>6165,"TextKey"=>"剧情ID228","Chinese"=>"0","English"=>"Ah Chief, here you are. Priest Enda said someone from his dream is waiting here for us. "],
6166=>["Value"=>6166,"TextKey"=>"剧情ID229","Chinese"=>"0","English"=>"I see some traces of human activity here, but this campfire went out, this tiny booth is about to break down, and I see no one around…We got stood up?"],
6167=>["Value"=>6167,"TextKey"=>"剧情ID230","Chinese"=>"0","English"=>"Anyway, let's build a Camp and spend the night here, and wait for that "person from dream" to show up."],
6168=>["Value"=>6168,"TextKey"=>"剧情ID231","Chinese"=>"0","English"=>"I'm so burnt out…Finally…this cloak feels like an oven! I'm getting roasted! Take it off!!"],
6169=>["Value"=>6169,"TextKey"=>"剧情ID232","Chinese"=>"0","English"=>"Dear priest, you were sleeping tightly on a camel's back just now. You don't get to say "burnt out.""],
6170=>["Value"=>6170,"TextKey"=>"剧情ID233","Chinese"=>"0","English"=>"By the way, you can't take your cloak off either. Even it's as hot as hades right now, it's still freezing at night."],
6171=>["Value"=>6171,"TextKey"=>"剧情ID234","Chinese"=>"0","English"=>"Dear God…Why bring me here…and having to put up with this arrogant young guy too…"],
6172=>["Value"=>6172,"TextKey"=>"剧情ID235","Chinese"=>"0","English"=>""I'll be waiting for you," but hey I don't see you!"],
6173=>["Value"=>6173,"TextKey"=>"剧情ID236","Chinese"=>"0","English"=>"Please be a little more patient. The Chief will gather the materials we need to build a tent here. I've put together a list, please check it out."],
