6226=>["Value"=>6226,"TextKey"=>"剧情ID234","Chinese"=>"0","English"=>"Dear God…Why bring me here…and having to put up with this arrogant young guy too…"],
6227=>["Value"=>6227,"TextKey"=>"剧情ID235","Chinese"=>"0","English"=>""I'll be waiting for you," but hey I don't see you!"],
6228=>["Value"=>6228,"TextKey"=>"剧情ID236","Chinese"=>"0","English"=>"Please be a little more patient. The Chief will gather the materials we need to build a tent here. I've put together a list, please check it out."],
6229=>["Value"=>6229,"TextKey"=>"剧情ID237","Chinese"=>"0","English"=>"Well done Chief for gathering the materials so fast! Let's get started!"],
6230=>["Value"=>6230,"TextKey"=>"剧情ID238","Chinese"=>"0","English"=>"Great! I believe people are all hungry by now. Let's make full use of this campfire and cook something. A little lounge area is also nice. Rest well work well!"],
6231=>["Value"=>6231,"TextKey"=>"剧情ID239","Chinese"=>"0","English"=>"Hooray! Food! Bacon! Sunny-side up!"],
6232=>["Value"=>6232,"TextKey"=>"剧情ID240","Chinese"=>"0","English"=>"Lamb chop for me please and a baked apple…"],
6233=>["Value"=>6233,"TextKey"=>"剧情ID241","Chinese"=>"0","English"=>"You savage carnivores!"],
6234=>["Value"=>6234,"TextKey"=>"剧情ID242","Chinese"=>"0","English"=>"So what do you want?"],
6235=>["Value"=>6235,"TextKey"=>"剧情ID243","Chinese"=>"0","English"=>"Steak, Medium with horseradish sauce please."],
6236=>["Value"=>6236,"TextKey"=>"剧情ID244","Chinese"=>"0","English"=>"Priest, that's also meat…"],
6237=>["Value"=>6237,"TextKey"=>"剧情ID245","Chinese"=>"0","English"=>"I know! Shush!"],
6238=>["Value"=>6238,"TextKey"=>"剧情ID246","Chinese"=>"0","English"=>"Haha, protein is very important to a traveling body. It's been a tough ride, so let's feast! What do you say, Chief?"],
6239=>["Value"=>6239,"TextKey"=>"剧情ID247","Chinese"=>"0","English"=>"We don't have that much materials to cook with…"],
6240=>["Value"=>6240,"TextKey"=>"剧情ID248","Chinese"=>"0","English"=>"We have mutton, dried beef and apples, Chief!"],
6241=>["Value"=>6241,"TextKey"=>"剧情ID249","Chinese"=>"0","English"=>"But Chief is right, we still want to save some of them for tougher nights later. So we need to find some alternative proteins."],
6242=>["Value"=>6242,"TextKey"=>"剧情ID250","Chinese"=>"0","English"=>"I caught sight on some desert lizards. Lizard eggs and themselves would be great sources of proteins!"],
6243=>["Value"=>6243,"TextKey"=>"剧情ID251","Chinese"=>"0","English"=>"What did you say?! Lizards?! How can we eat lizards?!"],
6244=>["Value"=>6244,"TextKey"=>"剧情ID252","Chinese"=>"0","English"=>"You may never know what kind of delicacy we can create with exotic materials we can find on these lands. For example, "lizard stew" sounds particularly appealing!"],
6245=>["Value"=>6245,"TextKey"=>"剧情ID253","Chinese"=>"0","English"=>"I can't wait!"],
6246=>["Value"=>6246,"TextKey"=>"剧情ID254","Chinese"=>"0","English"=>"Oh…...lizard hunting…..."],
6247=>["Value"=>6247,"TextKey"=>"剧情ID255","Chinese"=>"0","English"=>"Amazing! You've collected all the materials! Let's get moving!"],
6248=>["Value"=>6248,"TextKey"=>"剧情ID256","Chinese"=>"0","English"=>"Coming! Light up the campfire!"],
6249=>["Value"=>6249,"TextKey"=>"剧情ID257","Chinese"=>"0","English"=>"Finally…Food…I can't move any more…Sunny side-up…Steak…Baked Apple…"],
6250=>["Value"=>6250,"TextKey"=>"剧情ID258","Chinese"=>"0","English"=>"Mutton chop for Arlan, and sunny-side up for Kevin…And Priest Enda will be sharing this bowl of delicious lizard soup with me…"],
6251=>["Value"=>6251,"TextKey"=>"剧情ID259","Chinese"=>"0","English"=>"No one is sharing lizard stew!"],
6252=>["Value"=>6252,"TextKey"=>"剧情ID260","Chinese"=>"0","English"=>"Well, I think I will give this bowl of warm, steaming, yummy soup to our new friends then."],
6253=>["Value"=>6253,"TextKey"=>"剧情ID261","Chinese"=>"0","English"=>"New friends? What new friends?"],
6254=>["Value"=>6254,"TextKey"=>"剧情ID262","Chinese"=>"0","English"=>"Ah!!! Noooo!!!!Get these rats off me!!!!"],
6255=>["Value"=>6255,"TextKey"=>"剧情ID263","Chinese"=>"0","English"=>"First of all, they are not rats. Rats cannot be this big. According to my observation, they should be a kind of creature unique to the desert regions, Maubbits."],
6256=>["Value"=>6256,"TextKey"=>"剧情ID264","Chinese"=>"0","English"=>"Furthermore, they are social animals, and are surprisingly timid considering their impressive size. I assure you, these gentle creatures are completely harmless towards human beings."],
6257=>["Value"=>6257,"TextKey"=>"剧情ID265","Chinese"=>"0","English"=>"Ok ok I know!!! I don't care what they are! Get them off of me!!"],
6258=>["Value"=>6258,"TextKey"=>"剧情ID266","Chinese"=>"0","English"=>"Hmm…now that you've mentioned it, it's actually quite strange that they are not afraid of you at all. Maybe they were raised by humans…"],
6259=>["Value"=>6259,"TextKey"=>"剧情ID267","Chinese"=>"0","English"=>"Dear workers, would you be so kind and remove these lovely creatures from our priest?"],
6260=>["Value"=>6260,"TextKey"=>"剧情ID268","Chinese"=>"0","English"=>"Aye!"],
6261=>["Value"=>6261,"TextKey"=>"剧情ID269","Chinese"=>"0","English"=>"Hey! Give it back!"],
6262=>["Value"=>6262,"TextKey"=>"剧情ID270","Chinese"=>"0","English"=>"Hmm, and off they go. It seems they are still afraid of everyone but the priest."],
6263=>["Value"=>6263,"TextKey"=>"剧情ID271","Chinese"=>"0","English"=>"They took my staff! My beloved staff…"],
6264=>["Value"=>6264,"TextKey"=>"剧情ID272","Chinese"=>"0","English"=>"Poor priest, I guess we can follow their steps into the dragon remains? I'm quite curious about those little guys. "],
6265=>["Value"=>6265,"TextKey"=>"剧情ID273","Chinese"=>"0","English"=>"And to do that, we firstly need a windmill to help us transport people up and down considering how steep that slope is. I've made the list for you."],
